import React from 'react';
import PropTypes from 'prop-types';
import styles from './Text.module.css';

const Text = () => (
  <section className={styles.container}>
    <p>Lorem ipsum dolor sit amet, consectetur adipiscing elit. Mauris est sem, pretium eu volutpat at, posuere quis velit. Praesent non elit ac quam vulputate imperdiet. Praesent ipsum nulla, convallis vel sem in, accumsan consequat ex. Mauris molestie augue a justo pretium dapibus. Mauris ultricies velit et tempor maximus. Proin ac elit erat. Nulla facilisi. Nullam rutrum turpis eget nulla cursus, luctus luctus dolor tempus. Quisque sit amet tempus augue. Proin vel risus ac dolor pretium molestie eu vel eros.</p>

    <p>Donec eget purus molestie, sodales ex quis, luctus quam. Donec fermentum augue vel rutrum pellentesque. In nisl nibh, vestibulum convallis sem sed, volutpat efficitur risus. Sed vehicula nunc ligula, accumsan pulvinar neque pharetra nec. Proin sit amet elit varius, pulvinar ex vel, posuere lectus. Pellentesque ut augue vehicula enim tempor malesuada eget at quam. In hendrerit laoreet iaculis. Donec at turpis massa. Nulla enim neque, iaculis sed diam non, elementum suscipit magna. Vivamus ligula nibh, maximus eget gravida interdum, bibendum non ligula. Aenean scelerisque auctor urna eget pulvinar. Lorem ipsum dolor sit amet, consectetur adipiscing elit. Cras dictum pretium blandit. Nam quis urna ac orci dignissim bibendum. Nulla lectus enim, consectetur in blandit eu, facilisis at ligula. Proin imperdiet pharetra dui, quis dignissim justo sollicitudin sit amet.</p>

    <p>Quisque id velit fermentum, posuere enim vitae, semper ligula. Integer quis nulla ornare, euismod turpis nec, egestas odio. Donec eget neque et lectus varius scelerisque. Sed convallis semper ante quis congue. Curabitur commodo diam eu velit venenatis, a venenatis turpis cursus. Mauris id posuere ante. Nunc efficitur, lacus in scelerisque blandit, ex nibh faucibus diam, nec sagittis mi lectus ac erat. Nam erat sem, rhoncus sed risus vitae, facilisis consectetur urna. Sed at sapien congue, dapibus dui vel, luctus orci. Morbi egestas sed arcu vel semper. Vivamus vitae felis justo. Donec bibendum rutrum ultrices. Vivamus lorem tortor, tempus vitae semper sit amet, porttitor vitae nibh.</p>

    <p>Duis condimentum sodales turpis id consequat. Fusce eu rutrum tortor, et pretium lacus. Orci varius natoque penatibus et magnis dis parturient montes, nascetur ridiculus mus. Phasellus non scelerisque lectus. Duis rhoncus mollis orci, eget feugiat lectus vehicula et. Donec accumsan nec quam quis iaculis. Mauris tempor sollicitudin ligula, id ullamcorper urna varius sit amet. Nullam non nulla blandit, bibendum tortor in, porttitor sapien. Nam mollis dictum felis, nec aliquam orci cursus a. Vestibulum varius molestie consectetur. Nam iaculis ipsum et augue aliquet pharetra. Donec facilisis tellus vitae enim lacinia, quis pretium sapien condimentum. Maecenas quis tincidunt ante. In vel enim in lacus accumsan consectetur.</p>
  </section>
);

Text.propTypes = {};

export default Text;
